import random
import string
import base64
import os
from tkinter import *


class Generatorius:

    def __init__(self):
        self.slaptazodis = ""

    def f_ja_sistemos_elemento_spalva_button(self, spalva):
        self.sistemos_elemento_spalva_button = spalva
        # print(self.sistemos_elemento_spalva_button)

    def f_ja_generatorius(self):

        # print("password generator")

        try:
            slaptazodzio_ilgis = int(entry_ilgis.get())

        except ValueError:
            label_statusas["text"] = "Klaida. Slaptažodžio ilgis turi būti teigiamas sveikasis skaičius"
            return


        lower = ""
        upper = ""
        num = ""
        symbols = ""


        if slaptazodzio_ilgis < 0:
            label_statusas["text"] = "Klaida. Slaptažodžio ilgis turi būti teigiamas sveikasis skaičius"

        elif slaptazodzio_ilgis == 0:
            label_statusas["text"] = "Radot easter egg :) Bet slaptažodis sugeneruotas nebuvo"

        elif var1.get() == 0 and var2.get() == 0 and var3.get() == 0 and var4.get() == 0:
            label_statusas["text"] = "Klaida. Nepasirinkti jokie simboliai"

        else:

            if var1.get() == 1:

                counter = slaptazodzio_ilgis

                while counter > 0:
                    lower += string.ascii_lowercase
                    counter -= 1


            if var2.get() == 1:

                counter = slaptazodzio_ilgis

                while counter > 0:
                    upper += string.ascii_uppercase
                    counter -= 1

            if var3.get() == 1:

                counter = slaptazodzio_ilgis

                while counter > 0:
                    num += string.digits
                    counter -= 1

            if var4.get() == 1:

                counter = slaptazodzio_ilgis

                while counter > 0:
                    symbols += string.punctuation
                    counter -= 1

            visi_pasirinkti_simboliai = lower + upper + num + symbols

            temp = random.sample(visi_pasirinkti_simboliai, slaptazodzio_ilgis)

            self.slaptazodis = "".join(temp)

            # print(self.slaptazodis)

            entry_slaptazodis.configure(state="normal")
            entry_slaptazodis.delete(0, END)
            entry_slaptazodis.insert(0, self.slaptazodis)

            label_statusas["text"] = "Slaptažodis sugeneruotas"

            button_nukopijuoti.configure(state="normal")

    def f_ja_kopijuoti_i_clipboard(self):

        if self.slaptazodis != "":
            langas.clipboard_clear()
            langas.clipboard_append(entry_slaptazodis.get())
            langas.update()
            label_statusas["text"] = "Slaptažodis nukopijuotas"

            button_nukopijuoti["bg"] = "green3"
            button_nukopijuoti.after(1000, lambda: button_nukopijuoti.configure(background=self.sistemos_elemento_spalva_button))

        else:
            label_statusas["text"] = "Klaida. Slaptažodis dar nesugeneruotas"


icon_base64 = """"""
icondata = base64.b64decode(icon_base64)
tempFile = "temp_spynele.ico"
iconfile = open(tempFile, "wb")
iconfile.write(icondata)
iconfile.close()


langas = Tk()
langas.title("QuickPass")

langas.iconbitmap(tempFile)
os.remove(tempFile)
langas.geometry("353x137")
langas.resizable(False, False)
langas.attributes('-topmost', True)


generatorius = Generatorius()


label_ilgis = Label(langas, text="Slaptažodžio ilgis:")
entry_ilgis = Entry(langas)

var1 = IntVar()
c1 = Checkbutton(langas, text="lowercase",variable=var1, onvalue=1, offvalue=0)
var2 = IntVar()
c2 = Checkbutton(langas, text="uppercase",variable=var2, onvalue=1, offvalue=0)
var3 = IntVar()
c3 = Checkbutton(langas, text="numbers",variable=var3, onvalue=1, offvalue=0)
var4 = IntVar()
c4 = Checkbutton(langas, text="symbols",variable=var4, onvalue=1, offvalue=0)

label_slaptazodis = Label(langas, text="Slaptažodis:")
entry_slaptazodis = Entry(langas, state="disabled")

button_generuoti = Button(langas, text="Generuoti slaptažodį", command=generatorius.f_ja_generatorius)
button_nukopijuoti = Button(langas, text="Kopijuoti į Clipboard", command=generatorius.f_ja_kopijuoti_i_clipboard, state="disabled")

label_statusas = Label(langas, text="", bd=1, relief=SUNKEN, anchor=W)


label_ilgis.grid(row=0, column=0, sticky=W)
entry_ilgis.grid(row=0, column=1)

c1.grid(row=1, column=0)
c2.grid(row=1, column=1)
c3.grid(row=2, column=0)
c4.grid(row=2, column=1)

label_slaptazodis.grid(row=3, column=0, sticky=W)
entry_slaptazodis.grid(row=3, column=1, pady=5)

button_generuoti.grid(row=0, column=3, sticky=W + E, padx=5, pady=2.5)
button_nukopijuoti.grid(row=1, column=3, sticky=W + E, padx=5, pady=2.5)

label_statusas.grid(row=5, columnspan=10, sticky=W + E)


generatorius.f_ja_sistemos_elemento_spalva_button(button_generuoti["bg"])


langas.mainloop()
